{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/andralisman/case-study-in-r-bellabeat?scriptVersionId=90570337\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"2c6d0728","metadata":{"_cell_guid":"29843a21-12f8-4113-9c36-a70a59519019","_uuid":"d48fb8a7-0426-4c9e-899d-d6df26a4294a","papermill":{"duration":0.209764,"end_time":"2022-03-19T13:57:54.669866","exception":false,"start_time":"2022-03-19T13:57:54.460102","status":"completed"},"tags":[]},"source":["# **How Can a Wellness Technology Company Play It Smart?**\n","## **Case Study in R. Bellabeat**\n","#### By Andra Lisman"]},{"cell_type":"markdown","id":"93b091cf","metadata":{"_cell_guid":"5eed1c26-840b-441e-b60c-4675217e86d1","_uuid":"18b83d8d-f22d-44c3-a41d-2fd01b815804","papermill":{"duration":0.20789,"end_time":"2022-03-19T13:57:55.08261","exception":false,"start_time":"2022-03-19T13:57:54.87472","status":"completed"},"tags":[]},"source":["### **Table of Contents**\n","\n","#### 1. Introduction\n","#### 2. Ask Phase\n","#### 3. Prepare Phase\n","#### 4. Process Phase\n","    4.1. Analysis tool and tool preparation\n","    4.2. Uploading the dataframes\n","    4.3. Dataframes review and data cleaning\n","    4.4. Merging dataframes\n","#### 5. Analyze and Share Phases\n","    5.1. Summarising values\n","    5.2. Activity level\n","    5.3. Sleep levels\n","    5.4. Use of the Bellabeat device\n","    5.5. Correlations\n","#### 6. Act Phase"]},{"attachments":{"4ca80001-b6b2-4e0e-8f2c-a114839bc29e.jpg":{"image/jpeg":""}},"cell_type":"markdown","id":"e8bc0340","metadata":{"_cell_guid":"1b36e041-7b5b-46c5-b74f-b4b8a0e2d622","_uuid":"7742217c-1d83-4c71-bbd4-bcf645e18f3c","papermill":{"duration":0.206899,"end_time":"2022-03-19T13:57:55.496322","exception":false,"start_time":"2022-03-19T13:57:55.289423","status":"completed"},"tags":[]},"source":["### **1. Introduction**\n","\n","**Bellabeat** is a high-tech company that manufactures health-focused smart devices for women, founded in 2013 by Urška Sršen and Sando Mur. Their products collect data on nutrition, activity, sleep and stress empowering women with knowledge which help them better understand their habits and make healthier decisions.\n","\n","Here is a list of their current products:\n","* Bellabeat app: provides users with health data related to their activity, sleep, stress, menstrual cycle and mindfulness habits. \n","* Leaf: a wellness tracker that can be worn as a bracelet,necklace or clip, connected to the Bellabeat app to track activity, sleep and stress.\n","* Time: a wellness watcg that tracks activity,sleep and stress, connected to the Bellabeat app to get insights into the user's wellness.\n","* Spring: a water bottle that tracks daily water intake, connected to the Bellabeat app to track hydration levels.\n","* Bellabeat membership: a subscription-bases membership program for users, with 24/7 access to fully personalized guidance on nutrition, activity, sleep, health, beauty and mindfulness based on lifestyle and goals.\n","\n","![Bellabeat products 2.jpg](attachment:4ca80001-b6b2-4e0e-8f2c-a114839bc29e.jpg)"]},{"cell_type":"markdown","id":"5a330730","metadata":{"_cell_guid":"1f4286af-c04a-4bde-af7f-418ece4aa95e","_uuid":"c980d28c-a8c2-47b3-84d9-c4728787e23b","papermill":{"duration":0.204789,"end_time":"2022-03-19T13:57:55.906748","exception":false,"start_time":"2022-03-19T13:57:55.701959","status":"completed"},"tags":[]},"source":["### **2. Ask Phase**\n","\n","#### **Business task**\n","\n","This case study focuses on analyzing smart device usage data to gain insight into how consumers are using the Bellabeat device, which will help unlock new growth opportunities.\n","\n","#### **Stakeholders**\n","\n","* Urška Sršen - Bellabeat’s co-founder and Chief Creative Officer\n","* Sando Mur - Bellabeat’s co-founder and key member of Bellabeat executive team"]},{"cell_type":"markdown","id":"8c241133","metadata":{"_cell_guid":"90f6882d-9477-4a66-8c96-b747afc61df7","_uuid":"325ed926-f997-49a5-8fe3-8db767faa258","papermill":{"duration":0.228575,"end_time":"2022-03-19T13:57:56.371869","exception":false,"start_time":"2022-03-19T13:57:56.143294","status":"completed"},"tags":[]},"source":["### **3. Prepare Phase**\n","\n","#### **Dataset**\n","\n","The data source used for this analysis is [FitBit Fitness Tracker Data](http://www.kaggle.com/arashnic/fitbit), which is a public dataset made available through [Mobius](https://www.kaggle.com/arashnic). \n","\n","#### **Data privacy and accessibility**\n","\n","When verifying the [Metadata](https://www.kaggle.com/arashnic/fitbit/metadata) we can confirm that the dataset is an [open source](https://zenodo.org/record/53894#.X9oeh3Uzaao). The dataset has been generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016 and 05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n","\n","#### **Data organization**\n","\n","The data comes in 18 .csv files with several rows for each subject (ID). Part of the files have a long format, and others have a wide format.\n","\n","#### **Data limitations**\n","\n","The data is original, comprehensive and cited.\n","However, it includes a small sample, a small period of data collection (31 days) and it doesn’t show any demographic information, which translates in highly possibly biased data. Another limitation is that the data is not current (2016)."]},{"cell_type":"markdown","id":"15b450f7","metadata":{"_cell_guid":"6b099889-f645-46ca-a4a0-b9d7c6dbbac8","_uuid":"59dc90a7-c83a-4874-9f7a-a3fc8c21c940","papermill":{"duration":0.209667,"end_time":"2022-03-19T13:57:56.789138","exception":false,"start_time":"2022-03-19T13:57:56.579471","status":"completed"},"tags":[]},"source":["### **4. Process Phase**\n","\n","#### **4.1. Analysis tool and tool preparation**\n","\n","The analysis has been performed in R, which provides an accessible language to organize, modify and clean dataframes, and create insightful data visualizations for this analysis."]},{"cell_type":"code","execution_count":1,"id":"fa63a06d","metadata":{"_cell_guid":"e632060f-54f5-46ef-9e92-ba31b169daf7","_kg_hide-input":true,"_kg_hide-output":true,"_uuid":"0039480d-7dbf-4f49-bd7d-f049caa06907","collapsed":false,"execution":{"iopub.execute_input":"2022-03-19T13:57:57.209073Z","iopub.status.busy":"2022-03-19T13:57:57.206513Z","iopub.status.idle":"2022-03-19T14:02:22.419196Z","shell.execute_reply":"2022-03-19T14:02:22.417672Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":265.422942,"end_time":"2022-03-19T14:02:22.419403","exception":false,"start_time":"2022-03-19T13:57:56.996461","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘vroom’\n","\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘rlang’\n","\n","\n","Warning message in install.packages(\"dplyr\"):\n","“installation of package ‘rlang’ had non-zero exit status”\n","Warning message in install.packages(\"dplyr\"):\n","“installation of package ‘dplyr’ had non-zero exit status”\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["# Installing the packages that we will use\n","\n","install.p