 Creating and assigning the categories:\n","\n","use_of_device <- daily_activity_sleep %>%\n","  group_by(id) %>%\n","  summarize(date=sum(n())) %>%\n","  rename(days_used = date) %>%\n","  mutate(usage = case_when(\n","    days_used >= 1 & days_used <= 10 ~ 'low usage',\n","    days_used >= 11 & days_used <= 20 ~ 'mild usage',\n","    days_used > 20 ~ 'high usage'\n","  )) %>%\n","  group_by(usage) %>%\n","  summarise(id=n()) %>%\n","  mutate(usage_percentage = (id / sum(id))) %>%\n","  mutate(usage_percentage = formattable::percent(usage_percentage)) %>%\n","  arrange(usage_percentage)\n","\n","ggplot(data=use_of_device)+\n","  geom_col(mapping = aes(x=usage, y=(usage_percentage*100), fill=(usage_percentage*100)))+\n","  ylab(\"%\") +\n","  xlab(\"\")+\n","  scale_fill_gradient(low = \"48d1cc\", high = \"#1f6263\")+\n","  theme(plot.title = element_text(hjust = 0.5,vjust= 1, size = 22, face = \"bold\"),\n","        axis.text.x = element_text(angle = 0, size=11, vjust= 0.4),\n","        axis.text.y = element_text(size=11),\n","        legend.title = element_blank(),\n","        legend.position = \"none\")+\n","  labs(title = \"Use of Bellabeat device\")"]},{"cell_type":"markdown","id":"ea76c9f8","metadata":{"_cell_guid":"22caa929-ce26-42b4-861e-90c2c465a359","_uuid":"dabc3b43-0835-492d-a279-54d9d1b43d67","papermill":{"duration":0.325171,"end_time":"2022-03-19T14:03:14.430113","exception":false,"start_time":"2022-03-19T14:03:14.104942","status":"completed"},"tags":[]},"source":["**Insight:** We see that half of the users give a high usage to the Bellabeat device (more than 20 days). From the other half, most users (37,5% of the total) give the device a low usage (ten days or less)."]},{"cell_type":"markdown","id":"102c1572","metadata":{"_cell_guid":"9207bbf5-ef1f-4031-8399-885406011109","_uuid":"df8455bf-de35-4e19-b9db-26f7f7065d46","papermill":{"duration":0.320401,"end_time":"2022-03-19T14:03:15.073533","exception":false,"start_time":"2022-03-19T14:03:14.753132","s