(values=c('#3cbdbf','#c2694d', '#132324'))+\n","  scale_size_manual(values=c(2,3,4))+\n","  theme(legend.position=\"right\")+\n","  geom_smooth(method=\"lm\", se=FALSE, aes(color=factor(usage)))+\n","  labs(title = \"Device usage vs Steps\", x = \"Date\", y = \"Steps\")"]},{"cell_type":"markdown","id":"ddbd49f1","metadata":{"_cell_guid":"4c80a04d-040f-428e-9ca2-c6cc327f3425","_uuid":"3421bc8b-01a6-438b-870f-6d5b76325d67","papermill":{"duration":0.360433,"end_time":"2022-03-19T14:03:23.755213","exception":false,"start_time":"2022-03-19T14:03:23.39478","status":"completed"},"tags":[]},"source":["**Insight:** We notice that the users with a high usage of the Bellabeat device, kept total steps more or less the same during the whole period. Meanwhile, the total steps of the users with a low usage of the device has lowered gradually, and the one of the users with a mild usage of the device lowered the most."]},{"cell_type":"markdown","id":"9ffb3679","metadata":{"_cell_guid":"de73bd26-28e4-4c04-bca2-83dde7ced05b","_uuid":"6bd9e5bf-f71b-40b7-aac7-97998d739833","papermill":{"duration":0.349478,"end_time":"2022-03-19T14:03:24.455546","exception":false,"start_time":"2022-03-19T14:03:24.106068","status":"completed"},"tags":[]},"source":["### **2. Act Phase**\n","\n","With the previous analysis we reached the following **conclusions**:\n","most of the users (37,5%) are only somewhat active, with an average between 7500 and 9999 steps.\n","More than half of the users (51,17%) sleep less than the minimum of 7 hours recommended.\n","Half of the users used the Bellabeat device more than 20 days out of the 31 days period, and most of the other half used it 10 days or less.\n","There is no significant correlation between the total steps and the minutes asleep.\n","The users with a device usage of more than 20 days maintained the total daily steps more or less the same during the 31 days period, and the total daily steps of the rest of the users lowered gradually.\n","\n","Based on these findings, we need to encourage the users to:\n","* exceed the 10,000 steps per day, \n","* sleep at least 7 hours per night.\n","* use the device more\n","\n","My **recommendations** would be:\n","* App notifications with tips on how to exceed the 10,000 steps per day, such as:\n","    * taking the stair instead of elevators at work, at home or if you go shopping\n","    * if you're going somewhere by bus, get off one or two stops earlier and walk the rest\n","    * adding a daily routine with simple exercises\n","    * encouraging activities at home\n","* Adding notifications reminding the user that they need to prepare to go to sleep, and suggestions of bedroom setting and sleep-related habits, such as:\n","    * setting and sticking to a sleep schedule every day\n","    * practicing a relaxing pre-bed routine\n","    * minimizing potential disruptions of light and sound\n","    * optimizing the bed temperature and aroma\n","    * disconnecting from electronic devices for at least half hour before bed\n","    * monitoring the intake of caffeine and alcohol in the hours before bed\n","\n","\n","For further analysis, I would recommend Bellabeat to store a bigger sample of data and include characteristics such as age, demographics, preferences and lifestyle. The data could be obtained from periodic surveys done through the Bellabeat app."]},{"cell_type":"markdown","id":"2872251b","metadata":{"_cell_guid":"7e48d651-eb78-4d78-aa94-3b55f697c2f5","_uuid":"5d6187ff-01aa-49e3-bb6f-723ab65a556f","papermill":{"duration":0.346596,"end_time":"2022-03-19T14:03:25.156167","exception":false,"start_time":"2022-03-19T14:03:24.809571","status":"completed"},"tags":[]},"source":["<h2><center>Thank you for your time!</center></h2>"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"